script: |
  super -f text -I q7901.spq | sort > q7901.out

inputs:
  - name: q7901.spq
    data: |
      SELECT DISTINCT - + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 < - + col2 * + 69 * + + ( - - 36 );
  - name: tab1

outputs:
  - name: q7901.out
    data: |
      -59
      -68
      -96
